import React from "react";
import SocialLinksElement from "./SocialLinksElement";

function SocialLinksComponent(props){
    return (<>
        <p>Social Links</p>
        {<SocialLinksElement socialElement={props.links.current.socialLinks[0]}/>}
        {<SocialLinksElement socialElement={props.links.current.socialLinks[1]}/>}
    </>)
}

export default SocialLinksComponent;
